import "./portfolio.scss";

export default function Portfolio() {
  const list = [
    {
      id: "featured",
      title: "Featured"
    },
    {
      id: "skills",
      title: "Skills"
    },
    {
      id: "featured",
      title: "Featured"
    },
    {
      id: "featured",
      title: "Featured"
    },
    {
      id: "featured",
      title: "Featured"
    },
  ];
  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>
      <ul>

      </ul>
      <div className="container">
        <div className="item">
          <img src="https://assets-fr.imgfoot.com/media/cache/642x382/andre-ayew-swansea-2020.jpg" alt="" />
          <h3>Banking App</h3>
        </div>
        <div className="item">
          <img src="https://assets-fr.imgfoot.com/media/cache/642x382/andre-ayew-swansea-2020.jpg" alt="" />
          <h3>Banking App</h3>
        </div>
        <div className="item">
          <img src="https://assets-fr.imgfoot.com/media/cache/642x382/andre-ayew-swansea-2020.jpg" alt="" />
          <h3>Banking App</h3>
        </div>
      </div>
    </div>
  )
}
